import React from 'react'
import { Spinner } from 'react-bootstrap'
function Loader() {
    return (
        <Spinner 
        animation='border'
        role='status'
        style={{
            minHeight: '100vh',
            width: '100px',
            height: '100px',
            margin: 'auto',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center'
        }}
        >
            <span className='sr-only'></span>
        </Spinner>
    )
}

export default Loader
